import {React,useState} from 'react'
import { useNavigate } from 'react-router-dom';
import './Login.css';
import axios from "axios";

function refreshPage() {
    window.location.reload(false);
  }
const Login = () => {
    const [registerinputs , setRegisterInputs] = useState({
        name:"",
        age:"",
        email:'',
        phone_no:'',
        address:'',
        password:''
    })
    const [logininputs , setLoginInputs] = useState({
        value:"",
        password:''
    })
    const navigate = useNavigate();
    const handleRegisterInputs = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setRegisterInputs({...registerinputs,[name] : value})
      }
    const handeLoginInputs = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setLoginInputs({...logininputs,[name] : value})
		navigate('/services')
      }

    const handleRegisterSubmit = async(event)=>{
        event.preventDefault()
        const newRecord = {...registerinputs}
		const date = new Date();
		let day = date.getDate();
		let month = date.getMonth() + 1;
		let year = date.getFullYear();
		let currentDate = `${day}-${month}-${year}`;
		newRecord["activation_date"] = currentDate
		try {
			await axios.post('http://localhost:3000/register',newRecord);
			console.log("successfully posted")
		  } catch (error) {
			console.log(error);
		  }
		console.log(newRecord)
		}
  return (
    <div>
        <div className="login-wrap">
	<div className="login-html">
		<input id="tab-1" type="radio" name="tab" className="sign-in"/><label for="tab-1" className="tab">Sign In</label>
		<input id="tab-2" type="radio" name="tab" className="sign-up" checked/><label for="tab-2" className="tab">Sign Up</label>
		<div className="login-form">
			<div className="sign-in-htm">
				<div class="group">
					<label for="user" className="label">Email or Phone number</label>
					<input id="user" type="number" className="input"/>
				</div>
				<div className="group">
					<label for="pass" className="label">Password</label>
					<input id="pass" type="password" className="input" data-type="password"/>
				</div>
				<div className="group">
					<input type="submit" className="button" value="Sign In"/>
				</div>
				<div className="hr"></div>
			</div>
			<div className="sign-up-htm">
				<div class="group">
					<label for="user" className="label">Username</label>
					<input id="user" type="text" className="input" value="name" onChange={handleRegisterInputs}/>
				</div>
				<div className="group">
					<label for="pass" className="label">date</label>
					<input id="pass1" type="date" className="input" data-type="password" value="age" onChange={handleRegisterInputs}/>
				</div>
				<div className="group">
					<label for="pass" className="label">Email</label>
					<input id="pass2" type="email" className="input" value="email" onChange={handleRegisterInputs}/>
				</div>
                <div className="group">
					<label for="pass" className="label">Phone number</label>
					<input id="pass3" type="number" className="input" value="phone_no" onChange={handleRegisterInputs}/>
				</div>
                <div className="group">
					<label for="pass" className="label">Address</label>
					<input id="pass4" type="text" class="input" value="address" onChange={handleRegisterInputs}/>
				</div>
                <div className="group">
					<label for="pass" className="label">Password</label>
					<input id="pass5" type="password" className="input" data-type="password" value="password" onChange={handleRegisterInputs}/>
				</div>
				<div class="group">
					<input type="submit" className="button" onClick={handleRegisterSubmit} value="Sign Up"/>
				</div>
				
			</div>
		</div>
	</div>
</div>
    </div>
  )
}

export default Login
